import React from "react";
import "./style.css"

const arr=[1,2,3,4];
function display(value)
{
    return(<div className="seats">
        {value}
    </div>)
}
function seatBooking()
{
    return<div className="main"> 
        arr.map(display);
    </div>

}
export default seatBooking;
